from math import exp, log, erfc
import math
import numpy as np
from numba import jit, float64
from scipy.integrate import simpson
from scipy.stats import lognorm, norm

def get_integration_domain(t, expectations, i, mean_duration, param, number_of_points=15, alpha=0.01, beta=0.5,
                           gamma=0.8, base=exp(1)):
    if i == 0:
        return np.zeros(1)
    else:
        start_point = max(t[:i+1])
        upper_bound_expected_start = max(start_point, expectations[i-1] + mean_duration)
        extension_upper_bound_relative = (upper_bound_expected_start - start_point + mean_duration)/mean_duration
        ending_point = upper_bound_expected_start + extension_upper_bound_relative**beta * \
                       lognorm.ppf((1-alpha), s=param[1], scale=exp(param[0]))
        x = beta*start_point+np.logspace(log((1-gamma)*start_point, base), log(ending_point-beta*start_point, base),
                                         base=base, num=number_of_points)
    return x

def probability_density_finish_time(dist, param, i, x, t, int_list, has_ongoing=False, start_time=0,
                                    includes_emergency=False, emergency_dist='lognorm', emergency_param=(0, 0)):
    if i == 0:
        if has_ongoing:
            # t[0] is the current time, start_time is the start_time of the ongoing surgery
            return conditional_probability_density_duration(*param, x - start_time, t[0] - start_time)
        elif includes_emergency:
            return probability_density_duration(*emergency_param, x - t[0])
        else:
            return probability_density_duration(*param, x - t[0])
    elif i == 1 and has_ongoing and includes_emergency:
        z = int_list[i]
        x_minus_z = x - z
        z_positive = z[x_minus_z > 0]
        if len(z_positive) > 1:
            y = [probability_density_duration(*emergency_param, x-z_j) * probability_density_finish_time(
                dist, param, i-1, z_j, t, int_list, has_ongoing=has_ongoing, start_time=start_time,
                includes_emergency=includes_emergency, emergency_param=emergency_param)
                 for z_j in z_positive]
            integral = simpson(y, z_positive)
        else:
            integral = 0

        if x - t[i] > 0:
            return integral + probability_density_duration(*emergency_param, x-t[i])* \
                   cumulative_dist_finish_time(dist, param, i-1, t[i], t, int_list, has_ongoing=has_ongoing,
                                               start_time=start_time,
                                               includes_emergency=includes_emergency, emergency_param=emergency_param)
        else:
            return integral
    else:
        z = int_list[i]
        x_minus_z = x - z
        z_positive = z[x_minus_z > 0]
        if len(z_positive) > 1:
            y = [probability_density_duration(*param, x-z_j) * probability_density_finish_time(
                dist, param, i-1, z_j, t, int_list, has_ongoing=has_ongoing, start_time=start_time,
                includes_emergency=includes_emergency, emergency_param=emergency_param)
                 for z_j in z_positive]
            integral = simpson(y, z_positive)
        else:
            integral = 0
        return integral + probability_density_duration(*param, x-t[i])* \
               cumulative_dist_finish_time(dist, param, i-1, t[i], t, int_list, has_ongoing=has_ongoing,
                                           start_time=start_time,
                                           includes_emergency=includes_emergency, emergency_param=emergency_param)

def cumulative_dist_finish_time(dist, param, i, x, t, int_list, has_ongoing=False, start_time=0,
                                includes_emergency=False, emergency_dist='lognorm', emergency_param=(0, 0)):
    if i == 0:
        if has_ongoing:
            # t[0] is the current time, start_time is the start_time of the ongoing surgery
            return conditional_cumulative_dist_duration(*param, x - start_time, t[0] - start_time)
        elif includes_emergency:
            return cumulative_dist_duration(*emergency_param, x - t[0])
        else:
            return cumulative_dist_duration(*param, x - t[0])
    elif i == 1 and has_ongoing and includes_emergency:
        z = int_list[i]
        z_positive = z[x - z > 0]
        if len(z_positive) > 1:
            y = [cumulative_dist_duration(*emergency_param, x-z_j) * probability_density_finish_time(
                dist, param, i-1, z_j, t, int_list, has_ongoing=has_ongoing, start_time=start_time,
                includes_emergency=includes_emergency, emergency_param=emergency_param)
                 for z_j in z_positive]
            integral = simpson(y, z_positive)
        else:
            integral = 0
        total_result = integral + cumulative_dist_duration(*emergency_param, x-t[i])* \
                       cumulative_dist_finish_time(dist, param, i-1, t[i], t, int_list, has_ongoing=has_ongoing,
                                                   start_time=start_time,
                                                   includes_emergency=includes_emergency,
                                                   emergency_param=emergency_param)

        if math.isnan(total_result):
            print("Error")

        return total_result

    else:
        z = int_list[i]
        z_positive = z[x - z > 0]
        if len(z_positive) > 1:
            y = [cumulative_dist_duration(*param, x-z_j) * probability_density_finish_time(
                dist, param, i-1, z_j, t, int_list, has_ongoing=has_ongoing, start_time=start_time,
                includes_emergency=includes_emergency, emergency_param=emergency_param)
                 for z_j in z_positive]
            integral = simpson(y, z_positive)
        else:
            integral = 0
        return integral + cumulative_dist_duration(*param, x-t[i])* \
               cumulative_dist_finish_time(dist, param, i-1, t[i], t, int_list, has_ongoing=has_ongoing,
                                           start_time=start_time,
                                           includes_emergency=includes_emergency, emergency_param=emergency_param)


def conditional_probability_density_duration(m, s, x, k):
    if x <= k:
        return 0
    else:
        return probability_density_duration(m, s, x) / (1 - cumulative_dist_duration(m, s, k))

def conditional_cumulative_dist_duration(m, s, x, k):
    if x <= k:
        return 0
    else:
        return (cumulative_dist_duration(m, s, x) - cumulative_dist_duration(m, s, k)) / \
               (1 - cumulative_dist_duration(m, s, k))

@jit(float64(float64, float64, float64), nopython=True)
def probability_density_duration(m, s, x):
    if x <= 0:
        return 0
    else:
        return 1 / (x*s*2.5066282746310002) * exp(-0.5*(((log(x)-m)/s)**2))

@jit(float64(float64, float64, float64), nopython=True)
def cumulative_dist_duration(m, s, x):
    if x <= 0:
        return 0
    else:
        return 0.5*erfc(-(log(x)-m)/(s*1.4142135623730951))

def conditional_expectation(m, s, k):
    return exp(m + 0.5*s**2)*norm.cdf((m + s**2 - log(k))/s)/(1 - norm.cdf((log(k)-m)/s))

